// Filename: Header.js

import React from 'react';
import './header.css';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <nav class>
        <ul>
          <li><Link to="/">air tracker</Link></li>
          <li><Link to="/">about</Link></li>
          <li><Link to="/">search</Link></li>
          <li><Link to="/">info</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
